export function QuickLookNeonImage() {
  const [isOpen, setIsOpen] = useState(false);
  const [anchorId, setAnchorId] = useState('tooltip-anchor');

  const close = () => {
    setIsOpen(false);
  };

  const item = useMemo(() => {
    if (anchorId) {
      const id = items.findIndex(i => i.id === anchorId);
      if (id > -1) {
        return items[id];
      }
    }
    return null;
  }, [anchorId]);

  const Content = useCallback(() => {
    if (item) {
      return item.content;
    }
    return <></>;
  }, [item]);

  return <>
    <div className={`image-container`}>
      <SVGImage setAnchorId={setAnchorId} setIsOpen={setIsOpen} isOpen={isOpen} />
      <Tooltip anchorId={anchorId} isOpen={isOpen} className={`tooltip-container`}>
        <a onClick={close} className={`tooltip-close`}><CloseSvg /></a>
        <Content />
      </Tooltip>
    </div>
  </>;
}

